class Solution:
    def maxOperations(self, s: str) -> int:
        ones = [i for i in range(len(s)) if s[i] == '1']
        end = len(ones)
        ones.append(len(s))
        count = 0
        index = 0
        while index < end:
            current_index = ones[index]
            index += 1
            next_index = ones[index]
            if current_index + 1 < next_index:
                count += index
        return count
